import React from 'react';
import ReactDOM from 'react-dom';

function model(props){
  
    return(
        <div>
           <h1>{props.name}</h1>
           <br/>
           <h2>{props.address}</h2>
           <h2>{props.date}</h2>
          
        </div>
    )

}

export default model;
